V is een tvserie Drama/Sci-Fic. De eerste aflevering werd uitgezonden in november 2009.
De wereld ontwaakt met ruimteschepen boven alle grote steden. Ondanks dat de de aliens claimen in vrede te komen, zijn er een 
aantal die hen niet geloven. Erica Evans, werkend voor Homeland Security, ontdekt dat deze aliens plannen hebben om de overheid 
en bedrijven te infiltreren om zo de planeet over te nemen. Erica besluit om deel te nemen aan een verzetsbeweging waar o.a. ook 
Ryan, een alien die de wereld wil redden voor het mensenras, aan deelneemt. De aliens recruteren de jeugd van de aarde, waaronder 
Erica's zoon, om zo onwetend als spion te dienen.
